// src/App.js

import React from "react";
import CohortDetails from "./components/CohortDetails";

function App() {
  const cohorts = [
    {
      name: "React Cohort",
      status: "ongoing",
      startDate: "2025-07-01",
      endDate: "2025-09-01",
    },
    {
      name: "Spring Boot Cohort",
      status: "completed",
      startDate: "2025-04-01",
      endDate: "2025-06-01",
    },
  ];

  return (
    <div>
      {cohorts.map((cohort, index) => (
        <CohortDetails key={index} cohort={cohort} />
      ))}
    </div>
  );
}

export default App;
